import React from "react";
import colors from "../utils/colors";

function PlayNumber(props) {
  return (
    <button
      style={{ backgroundColor: colors[props.status] }}
      className="number"
      onClick={() => props.on}
    >
      {props.number}
    </button>
  );
}

export default PlayNumber;
